  }, err=>{
      return common.response(res, code.INTERNAL_SERVER_ERROR, message.INTERNAL_SERVER_ERROR, err)
  })
}

export default {

  verifyToken,
  createUser,
  getUserDetail,
  getByIdUser,
  getAllUser,
  updateUser,
  deleteUser
}

